INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('0583834340011', 'farine de petit épeautre t150', 'BIOCER 3 n suRs d située en Haute-Normandie, la coopérative Depuis 2002 Biocoop et Biocer sont Biocer 300% bio a été groupe d\'agriculteurs normands désireux Ensemble&quot;. De la production à la de mieux valoriser leurs productions via la distribution en passant par la transformation, cooperation. Aujourdhui, ce groupement cette démarche vise à sécuriser les de 150 agriculteurs du Nord-ouest de la différentes parties prenantes qui France collecte des céréales et légumineus - s\'engagent sur des volumes de marchan - es sur 7 régions. Spécialisée dans les dise, une qualité et une traçabilité ainsl ceréales panifiables, Biocer sélectionne des qu\'un prix rémunérateur pour tous. variétés de haute valeur boulangere. en 1988 par un partenaires au sein de la démarche Palns plats à la poêle Ingrédients pour 3 palns environs: 200g de farine de petit épeautre, 120 ml d\'eau tiede, 2 pincées de sel gris. Préparation: Dans 120 ml d\'eau tiède, faire fondre 2 pincées de sel gris. Ajouter 200g de farine de petit épeautre, pétrir s minutes jusqu\'à ce que la pâte soit homogène. Laisser reposer une heure minimum sous un linge. Rajouter au cholx des épices (cumin, curry, curcuma.) ou des graines (sésame, tournesol, pavot..). Prélever des boules de la taille d\'une mandarine, les aplatir au rouleau sur un plan de travail fariné. Culre à feu vif dans une poêle non graissée, environ 3 minutes de chaque côté, en appuyant avec une spatule pour que la galette gonfle. Parfait pour un plque nique, un apéritif, avec houmous, guacamole, caviar d\'aubergine, ou tout autre tartinade', 'https://static.openfoodfacts.org/images/products/058/383/434/0011/front_fr.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

